const url = new URL("http://localhost/docu/info");

let headers = {
    "Accept": "application/json",
    "Content-Type": "application/json",
}

fetch(url, {
    method: "GET",
    headers: headers,
})
    .then(response => response.json())
    .then(json => console.log(json));

$headers = [
    "Accept" => "application/json",
    "Content-Type" => "application/json",
];


$ch = curl_init("http://localhost/docu/info");
